                    </Route>


                    <Route path="/">
                        {localStorage.getItem("authtoken") ?
                            <Redirect to="/dachboard" />
                            :
                            <LandingPage />
                        }
                    </Route> */}

                </Switch>
            </Router>
        </>
    )
}

export default App;
